import './material.styles.css'
const MaterialCard = ({sem}) => {
    return(
        <div className = 'marks-card'>
         {
           Object.keys(sem).map(se =>{
            console.log(sem[se])
            return <div key = {se} >
                <h3>{se}</h3>
            <button><a href = {sem[se]['link']}>C;</a></button>
                <p>{sem[se]['link']}</p>

            </div> 
           })
         }
        </div>
    )
}

export default MaterialCard
